import React from "react";
import styled from "styled-components";

interface props {
  label: string;
  onClick?: () => void;
  //리턴문을 사용하지 않을 때 void
}

const Container = styled.div

const Button = ({ label, onClick }: props) => {
  return <Container>{label}</Container>;
};

export default Button;
